const { sm4 } = require('sm-crypto');

const data =
  "";


class SM4Decryptor {
  constructor(key) {
    if (!key || key.length !== 16) {
      throw new Error('Key must be a 16-byte buffer or string');
    }
    this.key = key;
  }

  decrypt(cipherText) {
    // 检查输入是否为Buffer或十六进制字符串
    if (typeof cipherText === 'string') {
      cipherText = Buffer.from(cipherText, 'hex');
    }

    // 使用sm-crypto库进行解密
    const decryptedData = sm4.decrypt(cipherText, this.key, { mode: 'cbc', iv: "kDrvPQfPIuArAzkF" });
    
    // 返回解密后的数据
    return decryptedData;
  }
}

// 示例使用
const key = 'MbzgvXzBWynQrtpy'; // 16字节密钥
const cipherText = data; // 需要解密的密文

const decryptor = new SM4Decryptor(key);
try {
  const decryptedData = decryptor.decrypt(cipherText);
  console.log('Decrypted data:', decryptedData.toString());
} catch (error) {
  console.error('Error during decryption:', error.message);
}


